            var string = ''; 

            for(var prop in obj) { 
               inforender+= <Info type="info" number={obj[prop]} title={prop}></Info>

            } 

            return string; 
        } 

        printObj(this.state.covidvalue);

       return(
<div className="body">
            <div className="row">

            </div>
        </div>
        )
    }
}

